import React, { Component } from 'react';
import Grid from '@mui/material/Grid';
import fblogo from '../../../src/images /logo.png';
import '../Navbar/Navbar.css';
class Navbar extends Component{
    constructor(props){
        super(props);
        this.state={};
    }
render(){
return(
<Grid container class="navbar__barContent">
    <Grid item xs={3}>
      <div class="navbar_leftBar">
        <img src={fblogo} class="navbar__img" placeholder="Search Facebook"/>
        <input type="text" class="navbar_searchBar"/>
      </div>
    </Grid>
    <Grid item xs={6}>g2</Grid>
    <Grid item xs={3}>g3</Grid>

</Grid>
);
}
}
export default Navbar;
